  \"The higher fungi of Amchitka and Adak Islands, Alaska\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:26.365859\",\n\t\"name\": \"the-higher-fungi-of-amchitka-and-adak-islands-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fruiting body collections of higher fungi,
  basidiomycetes and ascomycetes, were made during a twelve day field study on two
  of Alaska's Aleutian Islands, Amchitka and Adak. A total of 163 fungal collections
  were made. Of this total, 130 collections were basidiomycetes; 21 collections were
  ascomycetes; 11 were asco- and basidiolichens; and 1 was a myxomycete. The period
  from 22 August to 26 August, 1975, was spent on Adak where 51 collections were made,
  and of those 36 were basidiomycetes and 13 were ascomycetes. From 26 August to 2
  September, 1975, collecting was restricted to Amchitka where 112 collections were
  made, and of these 94 were basidiomycetes, 8 were ascomycetes and 10 were lichens.
  The fungi, in total, represented 33 genera in 17 families of basidiomycetes, 5 genera
  in 4 families of ascomycetes and 1 myxomycete. Three species of imperfect fungi
  have been isolated from hair grass. Deschampsia sp., and are being cultured for
  study. Collections of higher fungi were made from several habitats on Adak and from
  all three topoenvironments on Amchitka. Fungi found on Amchitka were most commonly
  associated with the transitional region between lowland and upland crowberry-sedge
  and crowberry-grass-sedge communities. One truly mycorrhizal species, in the genus
  Russula, was found on Amchitka. All other fungi were thought to be saprobic decomposers.
  The genera composite represented a late spring and summer flora common to lower
  latitudes. The maritime tundra mycoflora was distinct and showed almost no similarity
  to the mycoflora of the Arctic tundra.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
